import React from "react";
import ReactDOM from "react-dom";
import App from "./components/App";

ReactDOM.render(<App />, document.getElementById("root"));

const citrus = ["lime", "lemon", "orange"];
const fruits = ["apple", "banana", "pair", ...citrus]

console.log(fruits);
